import styled from 'styled-components'

import AppLayout from './AppLayout';

const AppWrapper = styled.div`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

export default function App() {
  return (
    <AppWrapper>
      <AppLayout/>
    </AppWrapper>
  );
}
